import React from 'react'
import  './Footer.css'

export const Footer = () => {
    return (
        <div className="footer">
            <div class="contact">
            <p class="contact_a">Need help?</p>
            <p class="contact_b">Contact us through our&nbsp;<a class="chakra-link css-no6ez4" href="/pages/customer-support-portal">Support Concierge</a></p>
            <p class="chakra-text css-37snhp">Or email us at&nbsp;<a target="_blank" rel="noopener" class="chakra-link css-1081t4c" href="mailto:support@luminskin.com">support@luminskin.com</a></p>
            </div>
            
        </div>
    )
}
